    return(
        <>
        <div>
       <container>
       <figure className="position-relative">
       <img src={about} alt="..." width="100%" height="250"  />
       </figure>
       <figcaption className="abt">
           About
       </figcaption>
       </container>
       </div>
      </>
    )

};

export default About;
